import React from 'react';
import Header from "./Header";
import Body from "./Body";
import AddBox from "./AddBox";
import styles from "./TodoList.module.css";

export default function TodoList() {
    return (
        <div className={styles.main}>
            <Header/>
            <Body/>
            <AddBox />
        </div>
    );
}
